import React, { useState } from 'react';

const TABS = ['Trending', 'Rising Creators', 'By Meta', 'For You'];
const STRATEGIES = {
  Trending: [
    {
      id: 1,
      user: 'Flows-ciper',
      title: 'Meta Rotator V2',
      description: 'Targets tokens with high wallet overlap across 3+ trending metas',
      winRate: 82,
      stats: '2+ SMART WALLET BUYS | VOLUME SPIKE > 200%'
    },
    {
      id: 2,
      user: 'AlphaWizard',
      title: 'Quick Pump',
      description: 'Identifies new tokens with fast volume and liquidity growth',
      winRate: 72,
      stats: 'VOLUME SPIKE > 150% | LP > 100 SOL'
    },
    {
      id: 3,
      user: 'QuantumTrades',
      title: 'Smart Whale + GambleFi',
      description: 'Combines whale tracking with GambleFi meta for high risk/reward',
      winRate: 54,
      stats: 'WHALE BUYS | GAMBLEFI | HIGH RISK'
    }
  ],
  'Rising Creators': [
    {
      id: 4,
      user: 'Newbie',
      title: 'Fresh Flow',
      description: 'Brand new strategy from a rising creator',
      winRate: 65,
      stats: 'NEW | EXPERIMENTAL'
    }
  ],
  'By Meta': [
    {
      id: 5,
      user: 'MetaMaster',
      title: 'Narrative Surge',
      description: 'Rides narratives gaining traction in a given day',
      winRate: 61,
      stats: 'GAMBLEFI | NARRATIVE | VOLUME'
    }
  ],
  'For You': [
    {
      id: 6,
      user: 'Personalized',
      title: 'Safe Flow (Liquidity Watcher)',
      description: 'Helps new users avoid rugs or sudden exits',
      winRate: 81,
      stats: 'SAFE | LIQUIDITY | HOLDER'
    }
  ]
};

export default function DiscoverTab() {
  const [activeTab, setActiveTab] = useState('Trending');
  const [selected, setSelected] = useState(null);

  if (selected) {
    // Show detail page for selected strategy
    return (
      <div className="min-h-screen bg-gradient-to-b from-zinc-900 via-black to-zinc-900 px-6 py-10 text-white">
        <button onClick={() => setSelected(null)} className="mb-6 flex items-center text-sm text-blue-400 bg-blue-500/5 px-4 py-2 rounded-lg backdrop-blur-sm transition-all hover:bg-blue-500/10">
          <span className="mr-2">←</span> Back
        </button>
        <div className="bg-black/40 rounded-xl p-6 border border-zinc-800 shadow-lg mb-8 max-w-2xl mx-auto">
          <div className="flex items-center justify-between mb-4">
            <div>
              <h1 className="text-2xl font-bold text-white mb-1">{selected.title}</h1>
              <div className="flex items-center gap-2">
                <span className="text-sm text-blue-400">@{selected.user}</span>
                <span className="bg-zinc-800 text-gray-300 rounded px-2 py-0.5 text-xs">Win Rate: <span className="text-green-400 font-bold">{selected.winRate}%</span></span>
              </div>
            </div>
            <div className="text-right">
              <button className="px-4 py-2 rounded bg-gradient-to-r from-blue-500 to-purple-500 text-white font-bold hover:opacity-90 transition">Trade</button>
            </div>
          </div>
          <p className="text-gray-300 mb-6">{selected.description}</p>
          <div className="text-xs text-zinc-400 mb-2">{selected.stats}</div>
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gradient-to-b from-zinc-900 via-black to-zinc-900 px-6 py-10 text-white">
      <h2 className="text-3xl font-bold mb-8 text-center">Trending trading workflows to get started</h2>
      <div className="flex gap-8 justify-center mb-8 border-b border-zinc-700">
        {TABS.map(tab => (
          <button
            key={tab}
            className={`pb-2 text-lg font-semibold transition-all ${activeTab === tab ? 'text-white border-b-2 border-white' : 'text-zinc-400'}`}
            onClick={() => setActiveTab(tab)}
          >
            {tab}
          </button>
        ))}
      </div>
      <div className="max-w-2xl mx-auto space-y-6">
        {STRATEGIES[activeTab].map(strategy => (
          <div key={strategy.id} className="bg-black/40 rounded-xl p-6 border border-zinc-800 shadow hover:border-blue-500/20 transition-all cursor-pointer" onClick={() => setSelected(strategy)}>
            <div className="flex items-center gap-2 mb-2">
              <span className="text-sm text-blue-400 font-bold">→ {strategy.user}</span>
            </div>
            <div className="flex justify-between items-center">
              <div>
                <div className="text-2xl font-bold text-white mb-1">{strategy.title}</div>
                <div className="text-base text-zinc-400 mb-2">{strategy.description}</div>
                <div className="text-xs text-zinc-400">{strategy.stats}</div>
              </div>
              <div className="flex flex-col items-end">
                <span className="text-green-400 font-bold text-lg mb-2">{strategy.winRate}% win rate</span>
                <button className="px-4 py-2 rounded border border-zinc-600 text-white hover:bg-zinc-800 transition">View Flow</button>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
